// src/router/index.js

import Vue from 'vue';
import Router from 'vue-router';
import MyTest from '@/components/MyTest';  // Ensure the path matches where your Test.vue is located

Vue.use(Router);

export default new Router({
  mode: 'history',
  routes: [
    {
      path: '/home',
      name: 'api_test',
      component: MyTest
    }
  ]
});
